import React, { Component } from 'react'

class AddItem extends Component {

    onChange = (e) => {
        console.log(e.target.value);

    }
    render() {
        return (

                <tr className="AddItem">

                    <td></td>
                    <td><input onChange={() => this.onChange(e)} type="text" name="TaskName" id="input" class="form-control"  required="required" pattern="" title="" /></td>
                    <td>
                        <select name="SelectType" id="inputSelectType" class="form-control" required="required">
                            <option value="">High</option>
                            <option value="">Medium</option>
                            <option value="">Low</option>
                        </select>
                    </td>
                    <td>
                        <button type="button" class="btn btn-default">Cancel</button>
                        <button type="button" class="btn btn-success">Save</button>
                    </td>
                </tr>
        )

}
}
export default AddItem
